import React from 'react';
import './InfoTab.css';

const InfoTab = ({ match }) => {
  const {
    venue,
    toss_won_team,
    winner_team,
    starting_at,
    stage,
    league,
    season,
    localteam,
    visitorteam,
    note,
  } = match;

  return (
    <div className="info-tab">
      <table>
        <tbody>
          <tr><th>Match</th><td>{localteam?.name} vs {visitorteam?.name}</td></tr>
          <tr><th>Venue</th><td>{venue?.name}, {venue?.city}</td></tr>
          <tr><th>Start Time</th><td>{new Date(starting_at).toLocaleString()}</td></tr>
          <tr><th>Toss Won</th><td>{toss_won_team?.name || 'TBD'}</td></tr>
          <tr><th>Winner</th><td>{winner_team?.name || 'TBD'}</td></tr>
          <tr><th>League</th><td>{league?.name}</td></tr>
          <tr><th>Season</th><td>{season?.name}</td></tr>
          <tr><th>Stage</th><td>{stage?.name}</td></tr>
          <tr><th>Status</th><td>{note || match.status}</td></tr>
        </tbody>
      </table>
    </div>
  );
};

export default InfoTab;
